import Layout from '../components/Layout';

const Homepage = () => {
    return (
        <Layout>
            <div className="hero">
                Test you triva skills anytime, anywhere.
            </div>
            <style jsx>
                {`
                .hero {
                    background-image: url('/static/hero.jpg');
                    background-size: cover;
                    border: 1px solid red;
                    min-height: 600px;
                    min-width: 100%;
                    background: white;
                }
                `}
            </style>
        </Layout>
    )
}
export default Homepage;
